import React, {useState , useEffect } from "react";
import "../index.css";

function AllProjects() {
    const [data , setData] = useState([]);

    useEffect(() => {
        fetch("http://localhost:3000/projects.json")
        .then((res) => res.json())
        .then((data) => setData(data))
    }, []);
    
}
